sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
// Test Postal Code Should be 0790177

  var obj = JSON.parse(inputs.responseBody);
  var arrResult = [];

  for (i = 0; i < obj.results.length; i++) {
    if (obj.results[i] != null) {
    	//var tmpArray = [];
      	var tmpObj = {};

      	var gd = new GlideDateTime().toString();

      	var strAddress1 = obj.results[i].address1;
    	var strAddress2 = obj.results[i].address2;
    	var strAddress3 = obj.results[i].address3;
    	var strAddress = strAddress1 + strAddress2 + strAddress3;

        //tmpArray.push(strAddress);
      	//tmpArray.push(gd);

      	tmpObj.Address=strAddress;
      	tmpObj.Date = gd;

    	arrResult.push(tmpObj); 
  	}
  }
  outputs.results2 = arrResult;
  gs.info("Test result is:\n " + JSON.stringify(outputs.results2, null, ' '));

})(inputs, outputs);

